import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

function Home() {
  const navigate = useNavigate();
  return (
    <div>
      <h1>Welcome to Miss Representation</h1>
      <p>Exploring and critiquing societal issues with wit and insight!</p>
      <button onClick={() => navigate('/try-it-out')}>Try It Out!</button>
    </div>
  );
}

export default Home;
